export const GET_CHAIN_BY_NAME = (name: string):Chain => {
  switch (name) {
    case "Goerli":
      return GOERLI
    case "Optimism":
      return OPTIMISM
    default:
      return INVALID_CHAIN
  }
}

export const GET_CHAIN_BY_HEX_ID = (hexId: string):Chain => {
  switch (hexId) {
    case "0x5": 
      return GOERLI
    case "0xa":
      return OPTIMISM
    default:
      return INVALID_CHAIN
  }
}